package com.example.lee.thirdRound;

import java.util.HashMap;
import java.util.Map;
import java.util.function.Function;
import java.util.stream.Collectors;
import java.util.stream.IntStream;

public class DistinctSubsequences {
    public int numDistinct(String s, String t) {
        if (s == null || t == null || s.length() < t.length()) {
            return 0;
        }
        int[][] dp = new int[s.length() + 1][t.length() + 1];
        for (int i = 0; i < s.length(); i++) {
            dp[i][0] = 1;
        }
        for (int i = 1; i <= s.length(); i++) {
            for (int j = 1; j <= t.length(); j++) {
                dp[i][j] = dp[i - 1][j];
                if (s.charAt(i - 1) == t.charAt(j - 1)) {
                    dp[i][j] += dp[i - 1][j - 1];
                }
            }
        }
        return dp[s.length()][t.length()];
    }
    /**
     * recursive + memoization but still not pass the leetcode because of Time Limit Exceeded
     * @param s
     * @param t
     * @return
     */
    public int numDistinctI(String s, String t) {
        if (s == null || t == null || s.length() < t.length() || !isValid(s, t)) {
            return 0;
        }
        return numDistinctHelper(s, t, new HashMap<>());
    }
    private int numDistinctHelper(String s, String t, Map<String, Map<String, Integer>> cached) {
        if (cached.containsKey(s) && cached.get(s).containsKey(t)) {
            return cached.get(s).get(t);
        } else if (t.length() == 0) {
            return 1;
        } else if (s.length() == 0) {
            return 0;
        } else if (!isValid(s, t)) {
            return 0;
        }
        int res = 0;
        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == t.charAt(0)) {
                res += numDistinctHelper(s.substring(i + 1), t.substring(1), cached);
            }
        }
        Map<String, Integer> map = cached.getOrDefault(s, new HashMap<>());
        map.put(t, res);
        cached.put(s, map);
        return res;
    }
    private boolean isValid(String s, String t) {
        Map<Character, Integer> map = IntStream.range(0, s.length())
                .mapToObj(i -> s.charAt(i))
                .collect(Collectors.toMap(Function.identity(), a -> 1, (a, b) -> a + b));
        for (int i = 0; i < t.length(); i++) {
            char ch = t.charAt(i);
            if (map.containsKey(ch) && map.get(ch) > 0) {
                map.put(ch, map.get(ch) - 1);
            } else {
                return false;
            }
        }
        return true;
    }
    /**
     * did not pass leetcode because out of time
     * @param s
     * @param t
     * @return
     */
    public int numDistinctII(String s, String t) {
        if (s == null || t == null || s.length() < t.length()) {
            return 0;
        }
        return numDistinctHelper(s, t, 0, 0);
    }

    private int numDistinctHelper(String s, String t, int idx1, int idx2) {
        if (idx2 == t.length()) {
            return 1;
        } else if (idx1 == s.length()) {
            return 0;
        }

        int len1 = s.length() - idx1;
        int len2 = t.length() - idx2;
        if (len1 < len2) {
            return 0;
        }
        int res = 0;
        for (int i = idx1; i < s.length(); i++) {
            if (s.charAt(i) == t.charAt(idx2)) {
                res += numDistinctHelper(s, t, i + 1, idx2 + 1);
            }
        }
        return res;
    }

    public static void main(String[] args) {
        DistinctSubsequences distinctSubsequences = new DistinctSubsequences();
        System.out.println(distinctSubsequences.numDistinct("",
                "rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys"));
    }
}
